INSERT INTO `artikel` (`id`, `judul`, `artikel`, `tanggal`, `dari`, `keterangan`, `coba`, `test`) VALUES
(4, 'Visi dan Misi', '<p><strong>Visi :&nbsp;</strong>Menjadi organisasi kemahasiswaan terdepan dalam berkarya di bidang persandian dan sebagai pelopor kemajuan bangsa dan negara.</p>\r\n\r\n<p><strong>Misi :&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>a.	menjadi wahana dan sarana pengembangan diri mahasiswa dalam belajar, berlatih, berkreasi dan berorganisasi,</li>\r\n	<li>b.	menumbuhkembangkan potensi minat, bakat, dan keterampilan mahasiswa,</li>\r\n        <li>c.	menjadi mitra penyelenggara pendidikan dalam proses pembinaan mahasiswa dalam kegiatan organisasi,</li>\r\n        <li>d.	menjadi wahana dan sarana dalam usaha pengabdian kepada masyarakat,</li>\r\n        <li>e.	memperjuangkan aspirasi mahasiswa secara bertanggung jawab,</li>\r\n        <li>f.	mengusahakan kesejahteraan mahasiswa, serta</li>\r\n        <li>g.  menciptakan kehidupan mahasiswa yang selaras, serasi, dan seimbang.</li>\r\n</ol>\r\n', 'Senin, 5 Februari 2018 | 21:26 WIB', 'DPM', '1', '', '');
